**Để giới hạn một số sự kiện cụ thể trong một kênh cụ thể:** 

[**Truy cập Bảng điều khiển Web của chúng tôi**](https://quark.bot/dashboard/{guild_id})

Để ngăn một số nội dung cụ thể không được ghi nhật ký, chạy:

{ignorecommand}

Để ẩn tất cả nội dung gửi đến ghi nhật ký máy chủ bằng cách sử dụng spoilers, chạy {spoilerscommand}
